import React from "react";
import "./App.css";

const Fields = () => {
  const text = "Typing...";
  return (
    <>
      <input type="text" placeholder={text} />
    </>
  );
};

const Button = () => {
  const isLogin = false;
  const btnText = "Click";
  return <button>{isLogin ? "Log In" : "Log Out"}</button>;
};

const App = () => {
  return (
    <div>
      <Header />
      <Fields />
      <Button />
    </div>
  );
};

export default App;
